import React from 'react';
import {
    Container,
    Card,
    Grid,
    Paper,
    Typography,
    Button,
    TextField,
    AppBar,
    Avatar,
    Toolbar,
} from "@mui/material";
import { styled } from '@mui/system';
import PersonIcon from '@mui/icons-material/Person';

function Login() {
    return (
        <LoginContainer>
            <Grid container spacing={2}>
                <LoginPaper elevation={2}>
                    {/* 엘리베이션 박스뒤에 음영강도 */}
                    <Grid item>
                        <PersonIcon />
                    </Grid>
                    <Typography>Log in</Typography>
                </LoginPaper>

            </Grid>
        </LoginContainer>
    )
}

export default Login;


const LoginContainer = styled(Container)({
    marginTop: "5rem", //마진 top 나중에 theme에 한꺼번에 넣기
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
})

const LoginPaper = styled(Paper)({
    width: 260,
    height: 320,
    display: "flex",
    justifyContent: "center"
})
